import React from 'react';
import Barra from '../Navbar/Navbar';
import Footer from '../Footer/Footer'

export const Contacto = () => {
  return (
      
  <div className='Fondo-app'>
          <Barra />
        <div>
            <h1>Contacto</h1>
        </div>
        <Footer />
    </div>
  );
};

export default Contacto;
